Aquisição de CADEIRAS DE RODAS, destinadas à distribuição nas Zonas Eleitorais do Estado, com o objetivo de proporcionar melhores condições de acessibilidade e atendimento ao público externo que busca os serviços da Justiça Eleitoral — especialmente cidadãos com deficiência, mobilidade reduzida ou idosos.

ESPECIFICAÇÕES TÉCNICAS DETALHADAS:
Condições Indispensáveis:

Uso seguro e confortável por pessoas adultas, com capacidade de até 120 kg;

Estrutura tubular em aço carbono, resistente, dobrável e de fácil manuseio;

Rodas maciças traseiras grandes e dianteiras pequenas, para movimentação estável;

Pneus maciços e rígidos;

Freios independentes para travamento seguro durante o uso;

Assento com almofada e capa de nylon e encosto em nylon reforçado, lavável e de fácil higienização;

Pintura epóxi de alta resistência;

Apoio de pés removíveis, rebatíveis lateralmente com regulagem de altura;

Garantia mínima de 12 (doze) meses;

Registro ANVISA.

Conforme Termo de Referência, Anexo I.
